ize: 12pt;"><br></span><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 12pt;">⑦.亚马逊(POD)签收单25/件。</span><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 12pt;"><br></span><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 12pt;">⑧.非纸质包装（全胶布覆盖箱子很可能产生该项附加费），外包装包装的包装，任何用金属、塑料或扎带捆扎的包装，或有轮子，脚轮，把手或带子的包装（包括外表面区域包装松散或内容物突出包装表面的包装），任何圆柱形包装加收180/件</span><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 12pt;"><o:p></o:p></span></p></td></tr><tr style="height:110.0000pt;"><td width="1682" valign="center" colspan="10" style="width:1261.5500pt;padding:0.0000pt 5.4000pt 0.0000pt 5.4000pt ;border-left:1.0000pt solid rgb(0,0,0);
